import React from "react";
import styled from "styled-components";
const Wrapper = styled.section`
  width: 100%;
  height: 585px;
  background-color: #47d99b;
`;
function SnsSection() {
  return (
    <Wrapper>
      <div className="logo">SNS</div>
      <div className="title">김과장 컨설팅 SNS</div>
    </Wrapper>
  );
}

export default SnsSection;
